import React from 'react'

export default class ListProducts extends React.Component{

    state = {
        products :[]
    }

    render(){
        return(
        <div className="card">
            <div className="card-header">
                List Products
            </div>    
            <div className="card-body">
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>SKU</th>
                            <th>Price</th>
                            <th>Suplier</th>
                            <th></th>
                        </tr>
                    </thead>

                    <tbody>
                        {
                            this.state.products.map( product => {
                                return(
                                    <tr>
                                    <th>{product.name}</th>
                                    <th>{product.sku}</th>
                                    <th>{product.price}</th>
                                    <th>{product.suplier}</th>
                                    <th></th>
                                </tr>
                                )
                            })
                        }
                    </tbody>   
                </table>
            </div>  
        </div>
        )
    }

}
